import "./movies.css";
import Skeleton from "react-loading-skeleton";
const Movies = () => {
  return (
    <>
      <div className="grid">
        <div className="card">
          <img src="" alt="">
            <h2 className="title"></h2>
          </img>
        </div>
        <div className="card">
          <img src="" alt="">
            <h2 className="title"></h2>
          </img>
        </div>
        <div className="card">
          <img src="" alt="">
            <h2 className="title"></h2>
          </img>
        </div>
      </div>
    </>
  );
};

export default Movies;
